import * as o from "react";
import r from "../lib/SSRBase.es.js";
import t from "../defs/Lamp.es.js";
const a = o.forwardRef((m, e) => /* @__PURE__ */ o.createElement(r, { ref: e, ...m, weights: t }));
a.displayName = "LampIcon";
const c = a;
export {
  c as Lamp,
  a as LampIcon
};
